def solve(A, B, C, D):
    """
    O(log(min(C, D)))
    """
    def gcd(n, m):
        if n % m == 0:
            return m
        return gcd(m, n%m)

    def lcm(n, m):
        return n * m // gcd(n, m)

    def f(x, C, D):
        return x - x // C - x // D + x // lcm(C, D)

    return f(B, C, D) - f(A - 1, C, D)

